import React from 'react';
import '../App.css';
import { Button } from './Button';
import './InfoSection.css';

function InfoSection() {
  return (
    <div className='info-container'>
      <h1>Promoting STEM for the general welfare of society</h1>
      <h2>In the areas of science, technology and entrepreneurship, we provide opportunities for:</h2>

      <div className='flexbox-container'></div>
      <div className='flexbox-item-1'></div>
      <div className='flexbox-item-2'></div>
      <div className='flexbox-item-3'></div>
      <div className='axis main-axis'></div>
      <div className='axis cross-axis'></div>
      <img src = '/images/img2.png' style = {{width : '180px', height : '180px', borderRadius : '5px'}} />
      <p>Hello</p>

    </div>
  );
}

export default InfoSection;

